import React from "react";

const Projects = (props) => {
	return (
		<div>
			<div>
				<h1></h1>
				<p></p>
			</div>
			<div>
				{props.websites.map((site) => {
					return <div key={site.id} className={site.className}></div>;
				})}
			</div>
		</div>
	);
};

export default Projects;
